import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Layout } from './components';

function App() {
  return (
    <Layout>
    <div className="App">
      <header className="App-header">
        <p className="text-muted">
          holas
        </p>
      </header>
    </div>
    </Layout>
  )
}

export default App;
